import logo from "./logo.svg";
import "./App.css";
import "./styles.css";
import DeleteChecklist from "./DeleteChecklist";
import { useState } from "react";

export default function App() {
  const [selected, setSelected] = useState();
  return (
    <div className="container">
      <div>
        <DeleteChecklist
          title={"Names"}
          items={[
            { name: "Ashley" },
            { name: "Carol" },
            { name: "David" },
            { name: "Monica" }
          ]}
          color={"black"}
          onClick={(selectedItems) => {
            alert(`You selected: ${selectedItems}`);
          }}
        ></DeleteChecklist>
        <p>
          Description: this is a checkbox list that lists out names in the color
          black. When this submit button is clicked, an alert with the selected
          items is shown.
        </p>
      </div>

      <div>
        <DeleteChecklist
          title={"Foods"}
          items={[
            { name: "Pizza" },
            { name: "Tacos" },
            { name: "Salad" },
            { name: "Mac and Cheese" },
            { name: "Fried Chicken" }
          ]}
          color={"blue"}
          onClick={(selectedItems) => {
            let s = <p>You selected: {selectedItems} </p>;
            setSelected(s);
          }}
        >
          let selectedItems = this.items;
        </DeleteChecklist>
        {selected}
        <p>
          Description: this is a checkbox list that lists out foods in the color
          blue. When this submit button is clicked, a list of items selected is
          displayed above.
        </p>
      </div>
    </div>
  );
}
